import React, {useState} from 'react';

export const IndividualListings = (child, setQuery, setSearch) => {

    console.log(child.display_name_prefixed);
    return (
        <a href={() => {setSearch(""); setQuery(child.display_name_prefixed)}} 
        className="block px-4 py-2 text-base text-gray-700 hover:bg-gray-100 hover:text-gray-900" 
        role="menuitem"
        >{child.display_name_prefixed}</a>
    )
}

export const SearchResDropDown = ({result, setQuery, setSearch}) => {

    if (result.length <= 0){
        console.log("First if result");
        return(<div></div>);
    }
    else {
        console.log(result);
        return(
            <div className="py-1" role="none">
                {result.map((obj, index) => {
                    <a href="#" 
                    className="block px-4 py-2 text-base text-gray-700 hover:bg-gray-100 hover:text-gray-900" 
                    role="menuitem"
                    >{obj.display_name_prefixed}</a>
                    
                })}
            </div>
        );
    }
}
